     //fullpage options
     licenseKey={"your licencekey here"}
     scrollingSpeed={1000} 
     loopBottom
     navigation
     render={({ state, fullpageApi }) => {
       return (
           <ReactFullpage.Wrapper>
             <div className="section">page1</div>
             <div className="section">page2</div>
             <div className="section"><BlogArea></BlogArea></div>
           </ReactFullpage.Wrapper>
       );
     }}
   />
      <div>
        <BlogArea></BlogArea>
      </div>
    </>
  );
}

export default App;
